import React from 'react';

const body = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
}

export default function Projects() {
    return (
        <div style={body}>
            <h1>Projects</h1>

            <image src="../assets/bachelor-article.png" alt="Article"></image>
        </div>
    );
}
